const messageKinds = {
  MESSAGE_CONNECTED: 1,
  MESSAGE_USER_JOINED: 2,
  MESSAGE_USER_LEFT: 3,
  MESSAGE_STROKE: 4,
  MESSAGE_CLEAR: 5,
  MESSAGE_CLIENT_SEND_INFO: 6,
  MESSAGE_STROKE_START: 7,
  MESSAGE_STROKE_END: 8,
  MESSAGE_GENERATE: 9,
  MESSAGE_STYLIZE: 10,
};

export default messageKinds;
